import React from 'react';


const Welcome = ({data}) => {

    return(
        <div>
            <h5>
                I hold { data ? data.Artist.length : 'No' } Artists 
            </h5>
            <h5>
                I hold { data ? data.Album.length : 'No' } Albums
            </h5>
        </div>
    )

}

export default Welcome;
